// To parse this JSON data, do////     final myResumeResponse = myResumeResponseFromJson(jsonString);import 'dart:convert';MyResumeResponse myResumeResponseFromJson(String str) => MyResumeResponse.fromJson(json.decode(str));String myResumeResponseToJson(MyResumeResponse data) => json.encode(data.toJson());class MyResumeResponse {  MyResumeResponse({    this.success,    this.resume,  });  bool? success;  Resume? resume;  factory MyResumeResponse.fromJson(Map<String, dynamic> json) => MyResumeResponse(    success: json["success"],    resume: Resume.fromJson(json["resume"]),  );  Map<String, dynamic> toJson() => {    "success": success,    "resume": resume?.toJson(),  };}class Resume {  Resume({    this.personalInfo,    this.educations,    this.experiences,    this.abilities,  });  PersonalInfo? personalInfo;  List<Education>? educations;  List<dynamic>? experiences;  Abilities? abilities;  factory Resume.fromJson(Map<String, dynamic> json) => Resume(    personalInfo: PersonalInfo.fromJson(json["personalInfo"]),    educations: List<Education>.from(json["educations"].map((x) => Education.fromJson(x))),    experiences: List<dynamic>.from(json["experiences"].map((x) => x)),    abilities: Abilities.fromJson(json["abilities"]),  );  Map<String, dynamic> toJson() => {    "personalInfo": personalInfo?.toJson(),    "educations": List<dynamic>.from(educations!.map((x) => x.toJson())),    "experiences": List<dynamic>.from(experiences!.map((x) => x)),    "abilities": abilities?.toJson(),  };}class Abilities {  Abilities({    this.skills,    this.languages,    this.certifications,  });  List<String>? skills;  List<String>? languages;  List<dynamic>? certifications;  factory Abilities.fromJson(Map<String, dynamic> json) => Abilities(    skills: List<String>.from(json["skills"].map((x) => x)),    languages: List<String>.from(json["languages"].map((x) => x)),    certifications: List<dynamic>.from(json["certifications"].map((x) => x)),  );  Map<String, dynamic> toJson() => {    "skills": List<dynamic>.from(skills!.map((x) => x)),    "languages": List<dynamic>.from(languages!.map((x) => x)),    "certifications": List<dynamic>.from(certifications!.map((x) => x)),  };}class Education {  Education({    this.id,    this.level,    this.major,    this.gStart,    this.gEnd,  });  String? id;  String? level;  String? major;  String? gStart;  String? gEnd;  factory Education.fromJson(Map<String, dynamic> json) => Education(    id: json["_id"],    level: json["level"],    major: json["major"],    gStart: json["gStart"],    gEnd: json["gEnd"],  );  Map<String, dynamic> toJson() => {    "_id": id,    "level": level,    "major": major,    "gStart": gStart,    "gEnd": gEnd,  };}class PersonalInfo {  PersonalInfo({    this.firstname,    this.lastname,    this.address,    this.contact,    this.email,    this.objective,    this.github,    this.linkedIn,  });  String? firstname;  String? lastname;  String? address;  String? contact;  String? email;  String? objective;  String? github;  String? linkedIn;  factory PersonalInfo.fromJson(Map<String, dynamic> json) => PersonalInfo(    firstname: json["firstname"],    lastname: json["lastname"],    address: json["address"],    contact: json["contact"],    email: json["email"],    objective: json["objective"],    github: json["github"],    linkedIn: json["linkedIn"],  );  Map<String, dynamic> toJson() => {    "firstname": firstname,    "lastname": lastname,    "address": address,    "contact": contact,    "email": email,    "objective": objective,    "github": github,    "linkedIn": linkedIn,  };}